        const [selectedCourier, setSelectedCourier] = useState(0);
        const [selectedIndex, setSelectedIndex] = useState(0);

    useEffect(() => {
        // Update the document title using the browser API

        const item = JSON.parse( localStorage.getItem('birlOrder'))
        setOrder(item)

    }, []);

    function saveOrder() {

        console.log(order)

        if(order){
            try {
                const responce = fetchSync(`https://app.wearebirl.com/discounts`, {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },
                    body: JSON.stringify({
                        "Handle": "lavenham-raydon-jacket-suffolk-navy",
                        "OrderId": "5349865685067",
                        "CustomerId": "6630886375499",
                        "CustomerEmail": "peter@uncover.team",
                        "CustomerName": "Peter Uncover",
                        "Shop": "birl-demo.myshopify.com",
                        "CategoryId": "1",
                        "Grade": "Like New",
                        "voucherType": "Normal",
                        "contact": {
                            "fullName": "Peter Haig",
                            "phoneNumber": "7894561230",
                            "email": "peter@uncover.team",
                            "address": "9 Newton Pl",
                            "city": "Glasgow",
                            "postcode": "G3 7PR",
                            "county": "Lanarkshire"
                        }
                    })

                }).json()


                //alert(JSON.stringify(responce))
                if(responce.code !== null){
                    accepted = true
                } else {
                    accepted = false
                }

                //accepted = true

            } catch (e) {
                //alert("There was an error saving your order, please try again" + JSON.stringify(e))
                accepted = false
            }
        } else {
            accepted = false
        }
        return accepted

    }

    function nextStep() {

            let status = saveOrder()

            if (status) {
                localStorage.setItem('birlOrder', null)
                return window.location.replace('/birl/trade-in/complete')
            } else {
                setError({
                    "status": 500,
                    "message": "There was an error saving your order, please try again"
                })


            }
    }

